sourcesContent:
import { Model, DataTypes } from 'sequelize';
import sequelize from '../config/database';
import Clinic from './clinic'; // Import model Clinic
import DentistSchedule from './dentistSchedule'
class Dentist extends Model { }
Dentist.init(
  {
    DentistID: {
      type: DataTypes.INTEGER,
      primaryKey: true,
      autoIncrement: true,
      allowNull: false,
    },
    DentistName: {
      type: DataTypes.STRING,
      allowNull: false,
      unique: true,
    },
    AccountID: {
      type: DataTypes.INTEGER,
      allowNull: false,
      references: {
        model: 'Account',
        key: 'AccountID',
      },
    },
    ClinicID: {
      type: DataTypes.INTEGER,
      allowNull: false,
      references: {
        model: 'Clinic',
        key: 'ClinicID',
      },
    },
    Description: {
      type: DataTypes.TEXT,
      allowNull: true,
    },
    ImagePath: {
      type: DataTypes.STRING,
      allowNull: true,
    },
  },
  {
    sequelize,
    modelName: 'Dentist',
    tableName: 'dentist',
    timestamps: false,
  }
);

// Thiết lập mối quan hệ giữa Dentist và Clinic
Dentist.belongsTo(Clinic, {
  foreignKey: 'ClinicID',
  as: 'clinic',
});

Dentist.belongsTo(DentistSchedule, {
  foreignKey: 'DentistID',
  as: 'schedules',
});

export default Dentist;

